import React, { useState } from "react";
import logo from "./ned.PNG";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
} from "reactstrap";

const Example = (props) => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

  return (
    <div>
      <Navbar color="light" light expand="md">
        <NavbarBrand href="https://www.neduet.edu.pk/" target="_blank">
          <img src={logo} />
        </NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          <Nav className="mr-auto" navbar>
            <NavItem>
              <NavLink href="/components/">Courses</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="#">PLOs</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="#">PEOs</NavLink>
            </NavItem>

            <NavItem>
              <NavLink href="#">Loguot</NavLink>
            </NavItem>
          </Nav>
        </Collapse>
      </Navbar>
    </div>
  );
};

export default Example;
